public void init()
{
    if (!InventParameters::find().UseQualityManagement)
    {
        throw error("@SYS114218");
    }

    traceFilter = element.args().parmObject() as InventTrackingQualityOrderSummaryFilter;
    if (traceFilter)
    {
        traceFilter.parmFormRun(this);
    }

    pdsFormCtrl_Table = PmfFormCtrl_InventQOTable_QOTable::newFromForm(element);
    pdsFormCtrl_Line = PmfFormCtrl_InventQOTable_QOLine::newFromForm(element);
    pdsFormCtrl_Table.initPre();
    pdsFormCtrl_Line.initPre();

    super();

    pdsFormCtrl_Table.setDatasources(inventQualityOrderTable);
    pdsFormCtrl_Line.setDatasources(inventQualityOrderLine);

    element.updateDesign(InventDimFormDesignUpdate::Init);

    pdsFormCtrl_Line.initPost();
    pdsFormCtrl_Table.initPost();
    // <GIN>
    if (TaxParameters::checkVatExciseParameters_IN())
    {
        inventQualityOrderTable_ds.object(fieldNum(InventQualityOrderTable, ApplyIndiaTaxes_IN)).visible(true);
        menuItemButtonSalesTax.visible(true);
    }
    // </GIN>

    if (traceFilter)
    {
        traceFilter.formInitPost();
        this.enableControlsForItemTracing();
    }

    // Move Tax Document  control logic to datasource active.

}

