/// <summary>
/// Update disposition status for shelf life driven quality orders.
/// </summary>
/// <remarks>
/// public void pdsUpdateDispositionStatus()
/// </remarks>
public void pdsUpdateDispositionStatus()
{
    if (#PdsShelfEnabled
        && inventQualityOrderTable.inventBatchId())
    {
        try
        {
            PdsUpdateDispositionStatus_Quality::newQuality(inventQualityOrderTable).runOperation();
        }
        catch (Exception::Error)
        {
            inventQualityOrderTable.doDelete();
            inventQualityOrderTable_ds.executeQuery();
        }
    }
}

