public void init()
{
    QueryBuildDataSource    qbds;
    QueryBuildDataSource    qbdsOrigin;
    QueryBuildDataSource    loadLinesQdbs;
    WHSShipmentTable        shipment;

    super();

    qbds = inventQualityOrderTable_ds.query().dataSourceTable(tableNum(InventQualityOrderTable));
    if (element.args())
    {
        switch (element.args().dataset())
        {
            case tableNum(InventSum):
                qbds.clearDynalinks();
                qbds.addDynalink(fieldNum(InventQualityOrderTable, ItemId), element.args().record(), fieldNum(InventSum, ItemId));
                break;
            case tableNum(InventBatch):
                qbds.clearDynalinks();
                qbds.addDynalink(fieldNum(InventQualityOrderTable, ItemId), element.args().record(), fieldNum(InventBatch, ItemId));
                break;
            case tableNum(InventNonConformanceTable):
                qbds.clearDynalinks();
                qbdsOrigin = qbds.addDataSource(tableNum(InventQualityOrderTableOrigin));
                qbdsOrigin.joinMode(JoinMode::ExistsJoin);
                qbdsOrigin.relations(true);
                qbdsOrigin.addDynalink(fieldNum(InventQualityOrderTableOrigin, InventNonConformanceID), element.args().record(), fieldNum(InventNonConformanceTable, InventNonConformanceID));
                break;
            case tableNum(InventNonConformanceOrigin):
                qbds.clearDynalinks();
                qbdsOrigin = qbds.addDataSource(tableNum(InventNonConformanceOrigin));
                qbdsOrigin.joinMode(JoinMode::ExistsJoin);
                qbdsOrigin.relations(true);
                qbdsOrigin.addDynalink(fieldNum(InventQualityOrderTableOrigin, InventQualityOrderId), element.args().record(), fieldNum(InventQualityOrderTableOrigin, InventQualityOrderId));
                break;
            case tableNum(WHSShipmentTable):

                shipment  = element.args().record() as WHSShipmentTable;

                loadLinesQdbs = qbds.addDataSource(tableNum(WHSLoadLine));
                loadLinesQdbs.joinMode(JoinMode::ExistsJoin);
                loadLinesQdbs.addLink(fieldNum(InventQualityOrderTable, InventRefTransId), fieldNum(WHSLoadLine, InventTransId));
                loadLinesQdbs.addRange(fieldNum(WHSLoadLine, ShipmentId)).value(shipment.ShipmentId);

                break;
        }
    }
    qbds.addSortField(fieldNum(InventQualityOrderTable, QualityOrderId));

    inventQualityOrderTable_ds.object(fieldNum(InventQualityOrderTable, RouteId)).allowEdit(false);
    inventQualityOrderTable_ds.object(fieldNum(InventQualityOrderTable, RouteId)).skip(true);
    pdsFormCtrl_Table.dataSourceInitPost(inventQualityOrderTable);

    if (traceFilter)
    {
        traceFilter.parmMainDataSource(inventQualityOrderTable_ds);
        traceFilter.parmFilterDataSource(inventQualityOrderTmpFilter_ds);
        traceFilter.dataSourceInitPost();
    }
}

