public void write(boolean _onlySuper = false)
{
    if (_onlySuper)
    {
        inCreateFromForm = true;
        super();
        inCreateFromForm = false;
    }
    else
    {
        using (InventChangeBlockingQtyOnDestructiveTestContext destructiveContext = InventUpdateBlockingQtyOnDestructiveTestFlight::instance().isEnabled() 
            ? InventChangeBlockingQtyOnDestructiveTestContext::construct() : null)
        {
            ttsbegin;

            // Reduce destructive qty for destructive tests
            if (destructiveContext
                && inventQualityOrderTable.TestDestructive
                && (inventQualityOrderTable.ReferenceType == InventTestReferenceType::Purch
                    || inventQualityOrderTable.ReferenceType == InventTestReferenceType::Production
                    || inventQualityOrderTable.ReferenceType == InventTestReferenceType::RouteOpr
                    || inventQualityOrderTable.ReferenceType == InventTestReferenceType::PmfProdCoBy)
                && (inventQualityOrderTable.Qty != inventQualityOrderTable.orig().Qty
                    || inventQualityOrderTable.PdsCWQty != inventQualityOrderTable.orig().PdsCWQty))
            {
                destructiveContext.parmSkipDeductDestructiveQty(true);

                inventQualityOrderTable.BlockingQty = inventQualityOrderTable.BlockingQty + inventQualityOrderTable.orig().Qty - inventQualityOrderTable.Qty;
                inventQualityOrderTable.BlockingQty = max(0, inventQualityOrderTable.BlockingQty);

                inventQualityOrderTable.PdsCWBlockingQty = inventQualityOrderTable.PdsCWBlockingQty + inventQualityOrderTable.orig().PdsCWQty - inventQualityOrderTable.PdsCWQty;
                inventQualityOrderTable.PdsCWBlockingQty = max(0, inventQualityOrderTable.PdsCWBlockingQty);
            }

            inventQualityOrderTable.InventDimId = InventDim::findOrCreate(inventDim).InventDimId;

            super();

            if (inventQualityOrderTable.InventDimId != inventDim.InventDimId)
            {
                inventDim.data(InventDim::find(inventQualityOrderTable.InventDimId));
                inventDim_ds.setCurrent();
            }

            ttscommit;

            inventQualityOrderTable.updateQualityOrderLineTestResult();

            inventQualityOrderLine_ds.executeQuery();
            inventQualityOrderLine_ds.active();
        }
    }

    inventQualityOrderTable_ds.reread();
    inventQualityOrderTable_ds.refresh();
}

void create(boolean _append         = false,
            boolean _onlySuper      = false)
{
    InventQualityOrderCreateForm    inventQualityOrderCreateForm;
    Common                          caller  = element.args() && element.args().record() ? element.args().record() : null;

    inventQualityOrderCreateForm = InventQualityOrderCreateForm::newQuality(element, inventQualityOrderTable, caller);

    if (_onlySuper)
    {
        super(_append);
    }
    else
    {
        createOrderId = '';
        using (InventCreateQualityOrderFromInventBatchContext context = InventCreateQualityOrderFromInventBatchContext::construct())
        {
            Object callerForm = element.args().caller();

            if (callerForm
                && caller
                && callerForm.name() == menuItemDisplayStr(InventBatch)
                && caller.TableId == tableNum(InventBatch)
                && inventQualityOrderTable.ReferenceType == InventTestReferenceType::Inventory)
            {
                context.parmCreateQualityOrderFromInventBatch(true);
            }

            inventQualityOrderCreateForm.run();
        }

        if (createOrderId)
        {
            element.setActive();
            inventQualityOrderTable_ds.insertAtEnd(true);
            super(true);
            inventQualityOrderTable_ds.insertAtEnd(false);

            inventQualityOrderTable.data(createOrderTable);
            inventDim.data(createinventDim);
            inventQualityOrderTable_ds.write(true);
        }
    }
}

