public int active()
{
    int ret;

    ret = super();

    if (ret)
    {
        element.checkTestType();
        UnitOfMeasureDecimalPrecision noOfDecimals = inventQualityOrderLine.setDecimal();
        InventQualityOrderLineMeasureValues_StandardValue.noOfDecimals(noOfDecimals);
        InventQualityOrderLineMeasureValues_LowerLimit.noOfDecimals(noOfDecimals);
        InventQualityOrderLineMeasureValues_UpperLimit.noOfDecimals(noOfDecimals);

        boolean isQualityOrderOpen = inventQualityOrderTable.RecId && inventQualityOrderTable.OrderStatus == InventTestOrderStatus::Open;
        inventQualityOrderLine_ds.allowEdit(isQualityOrderOpen);
        inventQualityOrderLine_ds.allowCreate(isQualityOrderOpen);
        inventQualityOrderLine_ds.allowDelete(isQualityOrderOpen);

        pdsFormCtrl_Line.dataSourceActivePost();
    }

    return ret;
}

