void clicked()
{
    try
    {
        super();

        if (#PdsShelfEnabled
            && inventQualityOrderTable.inventBatchId())
        {
            PdsUpdateDispositionStatus_Quality::newQuality(inventQualityOrderTable).runOperation();
        }
    }
    catch (Exception::Error)
    {
        element.refreshRecord();
        throw Exception::Error;
    }

    inventQualityOrderLine_ds.allowEdit(inventQualityOrderTable.OrderStatus == InventTestOrderStatus::Open);
    element.refreshRecord();
}

public void clicked()
{
    FormRun tmpInventQualityTaxTransForm;

    if (element.args().dataset() == tableNum(SalesTable)
        || (inventQualityOrderTable.ReferenceType == InventTestReferenceType::Sales
        && SalesTable::find(inventQualityOrderTable.InventRefId).canInvoiceOrderFromCurrentSalesStatus())
        && !CustInvoiceTrans::exist(inventQualityOrderTable.InventRefTransId))
    {
        if (!tmpInventQualityTaxTransForm || (tmpInventQualityTaxTransForm && tmpInventQualityTaxTransForm.closed()))
        {
            tmpInventQualityTaxTransForm = TaxSalesQualityOrder_IN::showTax(inventQualityOrderTable);
        }
    }
    else if (element.args().dataset() == tableNum(PurchTable)
            || (inventQualityOrderTable.ReferenceType == InventTestReferenceType::Purch
                &&  !(PurchTable::find(inventQualityOrderTable.InventRefId).isInvoiced()))
                && !VendInvoiceTrans::exist(inventQualityOrderTable.InventRefTransId))
    {
        if (!tmpInventQualityTaxTransForm || (tmpInventQualityTaxTransForm && tmpInventQualityTaxTransForm.closed()))
        {
            tmpInventQualityTaxTransForm = TaxPurchQualityOrder_IN::showTax(inventQualityOrderTable);
        }
    }
    else
    {
        super();
    }
}

public void clicked()
{
    if (inventQualityOrderTable.ReferenceType == InventTestReferenceType::Sales)
    {
        this.parameters(classStr(TaxableDocumentDescriptorQualityOrderCust));
    }
    else if (inventQualityOrderTable.ReferenceType == InventTestReferenceType::Purch)
    {
        this.parameters(classStr(TaxableDocumentDescriptorQualityOrderVend));
    }
    super();            
}

